import { StyleSheet, Text, View, Image } from 'react-native';
import React from 'react';

const SongPlaylistComponent = (props) => {
  console.log(props.item.name);
  return (
    <View numberOfLines={1} style={styles.container}>
      {/* Image cover */}
      {/* <Image source={}></Image> */}

      {/* Title */}
      <View style={styles.textContainer}>
        <View style={styles.titleContainer}>
          <Text style={styles.titleText}>{props.item.name}</Text>
        </View>

        {/* Artist */}
        <Text>{props.item.artists[0].name}</Text>
      </View>
    </View>
  );
};

export default SongPlaylistComponent;

const styles = StyleSheet.create({
  container: {
    height: 60,
    padding:10,
    backgroundColor: '#a273de',
    borderRadius:5,
    marginVertical: 3,
    flexDirection: 'row',
    justifyContent: 'space-between',
    minWidth: '100%',
    overflow: 'hidden',
    flexDirection: 'row',
  },
  textContainer: {},
  titleText: {
    fontWeight: '600',
  },
  titleContainer: {
    flex:1,
  },
  selected: {},
});
